import React from "react";

const About = () => {
  return (
    <div className="container">
      <div className="py-4">
        <h1>About Page</h1>
        <p className="lead">
         This project is created for the web development lab work for mid sem.
        </p>

        <p className="lead">
          NAME - AKASH PING
        </p>
        <p className="lead">
          SCHOLAR NO. - 212120012
          </p>
          <p className="lead">
          CA - 207 WEB DEVELOPMENT
          </p>
          <p className="lead">
          MAULANA AZAD NATIONAL INSTITUTION OF TECHNOLOGY, BHOPAL
          </p>
      </div>
    </div>
  );
};

export default About;
